Officer Nails and Officer Dames are called-in to investigate a domestic disturbance between Rebeca Linares and her boyfriend Johnny. When the officers arrive on location they have to split up the couple because they are out of control. Officer Nails tries to relax Rebeca, but after she repeatedly insults Officer Nails he shows her why cops are called dirty. insults
